el(function(w,d){var l=d.getElementById('l'),m=d.getElementById('menu'),ml=d.getElementById('menuLink'),c=d.getElementById('main');function toggleClass(el,cn){var cl=el.className.split(/\s+/),length=cl.length,i=0;for(;i<length;i+=1){if(cl[i]===cn){cl.splice(i,1);break}}if(length===cl.length){cl.push(cn)}el.className=cl.join(' ')}function toggleAll(e){var a='active';e.preventDefault();toggleClass(l,a);toggleClass(m,a);toggleClass(ml,a)}ml.onclick=function(e){toggleAll(e)};c.onclick=function(e){if(m.className.indexOf('active')!==-1){toggleAll(e)}}}(this,this.d));
